import React from "react";

const DetailAdress = (props) => {
  //   const name = props.adress.map((e) => e.name);
  //   console.log(name);
  return (
    <div className="container">
      {props.adress.map((adress) => {
        return (
          <div className="detail-address">
            <div>
              <h3>{adress.name}</h3>
              <p>
                <i class="fa fa-map-marker"> {" " + adress.address}</i>
              </p>
              <p className="text-primary">{adress.distance}</p>
              <p className="text-success">{adress.price}</p>
            </div>
            <div>
              <button>Reserve or Book Now!</button>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default DetailAdress;
